import { loadStripe } from "@stripe/stripe-js";
import { Button } from "antd";
import { API, graphqlOperation } from "aws-amplify";
import { v4 as uuidv4 } from "uuid";
import { processPayment } from "../../../graphql/mutations";

const PaymentButtonContent = () => {
  const handlePay = async () => {
    const payload = {
      id: uuidv4(),
      total: "5",
      success_url: "http://localhost:3000/results",
      cancel_url: "http://localhost:3000/results",
    };

    const stripePromise = await loadStripe(
      "pk_test_51K6Lv8JfUhuzTQLsnTrk8sZTeap3i5f9QUCq8UlN4Rk0LRc77GbxppRAAqW5yl6RimUU1DSEymcAw4ioHnyAoCI000QFZV7fIs"
    );

    const response: any = await API.graphql(
      graphqlOperation(processPayment, { input: payload })
    );

    console.log(response.data.processPayment);

    stripePromise
      ?.redirectToCheckout({
        // Make the id field from the Checkout Session creation API response
        // available to this file, so you can provide it as parameter here
        // instead of the {{CHECKOUT_SESSION_ID}} placeholder.
        sessionId: response.data.processPayment,
      })
      .then(function (result: any) {
        console.log(result.error.message);
        // If `redirectToCheckout` fails due to a browser or network
        // error, display the localized error message to your customer
        // using `result.error.message`.
      });
  };

  return (
    <Button type="primary" onClick={handlePay}>
      Pay with Stripe
    </Button>
  );
};

export default PaymentButtonContent;
